import React from 'react';

const Profile = ({onEditAvatar, avatar, name, about, onEditProfile, onAddPlace}) => {
    return (
        <section className="profile">
            <button onClick={onEditAvatar} type="button" className="profile__avatar-container">
                <img alt="Аватар" className="profile__avatar" src={avatar}/>
            </button>
            <div className="profile__info">
                <h1 className="profile__name">{name}</h1>
                <p className="profile__description">{about}</p>
                <button onClick={onEditProfile} type="button" className="profile__edit-button"/>
            </div>
            <button onClick={onAddPlace} type="button" className="profile__add-button"/>
        </section>
    );
};

export default Profile;
